  const WishList = (props) => {

  const [ wishList, setWishList ] = useContext(WishlistDataContext);
  console.log("###Data coming from the context", wishList);
  console.log( "aaa" + wishList);
  return (
    <div>
      <table key={wishList.map((wish) =>  wish.id)}>
        <tbody>
          <tr>
            <td>
              <img
                src={console.log("poster source", wishList) || wishList.map((wish) =>  wish.poster_src)}
                className="moviePic"
